import React from 'react';
import './App.css';
import { BrowserRouter, Route, Link, Switch } from 'react-router-dom';


import Header from './components/Header/Header';
import Home from './components/Home/Home';


function App() {
  return (
    <BrowserRouter>
      <Header />
      <Switch>

      </Switch>
      <Route path="/" component={Home} />
    </BrowserRouter>
  );
}

export default App;
